  "text" : "東日本大震災の被害が大きくなった背景の1つとして「できる防災対策をしなかった」というのが挙げられている。例として、仙台のある建設会社の話で、予算削減によって堤防の高さを低くせざるを得なくなって、それが原因で壊滅的被害となった、と。（土木学会誌vol.97、p.68）",
